import * as types from '../../action_types'
export function showInfowindow(item){

    return{
        type:types.SHOW_INFOWINDOW_VIOLATION,
        payload:item
    }
}
export function clearInfowindow(){

    return{
        type:types.CLEAR_INFOWINDOW_VIOLATION,
    }
}
export function getSearchViolationRequest(){
    console.log(types);

    return{
        type:types.GET_SEARCH_VIOLATION_REQUEST
    }
}
export function getSearchViolationSuccess(data){
    return{
        type:types.GET_SEARCH_VIOLATION_SUCCESS,
        payload:data
    }
}
export function getSearchViolationFailure(err){
    return{
        type:types.GET_SEARCH_VIOLATION_FAILURE,
        err
    }
}
